INSERT INTO `wp_posts` VALUES (2,123,'2016-03-15 14:18:09','2016-03-15 14:18:09','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost:8081/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','','sample-page','','','2016-03-15 14:18:09','2016-03-15 14:18:09','',0,'http://localhost:8081/wordpress/?page_id=2',0,'page','',0),(9,125,'2016-06-14 07:34:10','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2016-06-14 07:34:10','0000-00-00 00:00:00','',0,'http://192.168.0.78:8081/wordpress/?p=9',0,'post','',0),(10,125,'2016-06-14 07:38:52','2016-06-14 07:38:52','It was so easy to hack into the web application. Never thought it would be such easy to get into this!!!','Never thought this would happen','','publish','open','open','','never-thought-this-would-happen','','','2016-06-14 07:38:59','2016-06-14 07:38:59','',0,'http://192.168.0.78:8081/wordpress/?p=10',0,'post','',0),(11,125,'2016-06-14 07:38:52','2016-06-14 07:38:52','It was so easy to hack into the web application. Never thought it would be such easy to get into this!!!','Never thought this w